import React from "react";

interface CardProps {
    children: React.ReactNode;
    cardData: {
        id: number;
        userId: number;
        plan: string;
        dateStart: string;
        dateEnd: string;
        status: string;
        comsumption: {
            totalComsumption: number;
        };
        flag: string;
        country: string;
    };
}

const Card: React.FC<CardProps> = ({ children, cardData})
